pragma solidity 0.6.3;

contract Dex {

    struct Token {
        bytes32 ticker;
        address tokenAdress;
    }

    mapping(bytes32 => Token) public tokens;
    bytes32[] public tokenList; // List to keep track of the Tickers in order to be able to loop through the mapping
    address public admin;

    constructor() public {

    }
}
